import ExpenseItem from './Expenseltem';
import './Expenses.css';
import Card from '../UI/Card';
import ExpensesFilter from '../NewExpense/ExpensesFilter';

const Expenses = (props) => {
    const filterDate = '';
    const saveExpenseDate = (dates) => {
        props.onExpenseDate(dates);
        filterDate= props.item.filter((expense) => expense.date.getFullYear().toString() === dates)
    }


    return (
        <Card className='expenses'>
            <ExpensesFilter onDateFilter={saveExpenseDate} /> 
            {filterDate.map((expense) => {<ExpenseItem key = {expense.id} title={expense.title} amount={expense.amount} date={expense.date} />})}
        </Card>
    )
}

export default Expenses;
